import { useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import Swal from "sweetalert2";
import { useAuth } from "../context/AuthContext";
import { FaSignOutAlt, FaUserCircle } from "react-icons/fa";
import { Link } from "react-router-dom";

const Register = () => {
  const { username, logout } = useAuth();
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    username: "",
    email: "",
    password: "",
    role: "user",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post("/api/users/register", formData);
      Swal.fire("Usuario registrado", "El nuevo usuario fue creado", "success");
      navigate("/admin/users");
    } catch (error) {
      Swal.fire("Error", error.response?.data?.message || "Error al registrar", "error");
    }
  };

  const handleLogout = () => {
    logout();
    navigate("/login");
  };

  return (
    <>
      {/* Mini Navbar */}
      <nav className="navbar navbar-expand-lg navbar-dark bg-dark px-4 py-2 mb-4">
        <div className="container-fluid d-flex justify-content-between align-items-center">
          <div className="d-flex align-items-center gap-3 text-white">
            <FaUserCircle size={24} />
            <strong>Hola, {username}</strong>
          </div>
          <div className="d-flex gap-3">
            <Link to="/admin/tareas" className="btn btn-outline-light btn-sm">Tareas</Link>
            <Link to="/admin/users" className="btn btn-outline-light btn-sm">Usuarios</Link>
            <Link to="/register" className="btn btn-outline-light btn-sm">Registrar Usuario</Link>
            <button
              className="btn btn-danger btn-sm d-flex align-items-center gap-1"
              onClick={handleLogout}
            >
              <FaSignOutAlt />
              Salir
            </button>
          </div>
        </div>
      </nav>

      {/* Formulario centrado */}
      <div className="d-flex justify-content-center align-items-center" style={{ minHeight: "70vh" }}>
        <form onSubmit={handleSubmit} className="bg-light p-4 rounded shadow" style={{ maxWidth: "400px", width: "100%" }}>
          <h4 className="mb-4 text-center fw-bold">Registrar nuevo usuario</h4>

          <div className="mb-3">
            <label className="form-label">Nombre de usuario</label>
            <input
              type="text"
              className="form-control"
              name="username"
              value={formData.username}
              onChange={handleChange}
              required
            />
          </div>

          <div className="mb-3">
            <label className="form-label">Correo electrónico</label>
            <input
              type="email"
              className="form-control"
              name="email"
              value={formData.email}
              onChange={handleChange}
              required
            />
          </div>

          <div className="mb-3">
            <label className="form-label">Contraseña</label>
            <input
              type="password"
              className="form-control"
              name="password"
              value={formData.password}
              onChange={handleChange}
              required
            />
          </div>

          <div className="mb-4">
            <label className="form-label">Rol</label>
            <select
              className="form-select"
              name="role"
              value={formData.role}
              onChange={handleChange}
            >
              <option value="user">Usuario</option>
              <option value="admin">Administrador</option>
            </select>
          </div>

          <button type="submit" className="btn btn-primary w-100">
            Registrar
          </button>
        </form>
      </div>
    </>
  );
};

export default Register;
